import React from "react";
import Nav from "../Nav";
import "./contact.css";

const Contact = () => {
  return (
    <div>
      <Nav></Nav>

      <div className="restcontact">
        <div className="contactcard"></div>
        <div className="contactlink"></div>
      </div>
    </div>
  );
};

export default Contact;
